import React, { Fragment } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Navbar from './components/layout/Navbar';

const App = () => {
  return (
    <Router>
      <Fragment className='App'>
        <Navbar />
        <Routes>
          <Route path='/' component={<Home />}></Route>
        </Routes>
      </Fragment>
    </Router>
  );
};

export default App;
